import Slider from '@material-ui/core/Button';

const Buttons = () => {
    return (
        <div className="Buttons">
            <Button variant="contained" color="optimize">
                Optimize
            </Button>
            <Button variant="contained" color="stop">
                Stop
            </Button>
        </div>
    );
};

export default Buttons;
